import React, { Component } from 'react';


class Home extends Component {
  render() {
    return (
      <div>
        <div style={{height: '70vh', minHeight: 600, flexGrow: 1, backgroundColor: '#565656', position: 'fixed', top: 0, zIndex: 1, display: 'flex', flexDirection: 'row', justifyContent: 'center', alignItems: 'center'}}>
          <div style={{background: 'lightgray', height: 200, width: 200}}></div>
        </div>
        <div style={{minHeight: '100vh', width: '100%', top: '70vh', zIndex: 2, backgroundColor: '#f8f8f8', position: 'absolute'}}>
          asdf
        </div>
      </div>
    );
  }
}

export default Home;
